contracts/CommodityExchange.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.26;

import "./IHederaTokenService.sol";
import "./TokenAuthority.sol";

contract CommodityExchange {
    address public admin;
    TokenAuthority public tokenAuthority;

    struct Commodity {
        string commodityType;
        address producer;
        int64 quantity;
        uint256 price;
        uint256 deliveryWindow;
        bool isActive;
    }

    mapping(uint256 => Commodity) public commodities;
    uint256 public commodityCount;

    mapping(string => bool) public approvedCommodities;

    event CommodityListed(uint256 indexed commodityId, string indexed commodityType, address indexed producer, int64 quantity, uint256 price, uint256 deliveryWindow);
    event CommodityApproved(string indexed commodityType);
    event CommodityRemoved(string indexed commodityType);

    constructor(address _tokenAuthority) {
        tokenAuthority = TokenAuthority(_tokenAuthority);
        admin = msg.sender;
    }

    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this action");
        _;
    }

    modifier onlyTokenAuthority() {
        require(msg.sender == address(tokenAuthority), "Only TokenAuthority can perform this action");
        _;
    }

    function approveCommodity(string memory commodityType) external onlyAdmin {
        approvedCommodities[commodityType] = true;
        emit CommodityApproved(commodityType);
    }

    function removeCommodity(string memory commodityType) external onlyAdmin {
        approvedCommodities[commodityType] = false;
        emit CommodityRemoved(commodityType);
    }

    function listCommodity(string memory commodityType, int64 quantity, uint256 price, uint256 deliveryWindow) external {
        require(quantity > 0, "Quantity must be greater than zero");
        require(price > 0, "Price must be greater than zero");
        require(deliveryWindow > block.timestamp, "Delivery window must be in the future");

        // check if commodityType is approved
        require(approvedCommodities[commodityType], "Commodity type not approved for listing");

        // Request token minting
        int64 responseCode = tokenAuthority.requestMinting(commodityType, quantity, deliveryWindow, msg.sender);
        require(responseCode == 0, "Token minting failed");

        uint256 commodityId = commodityCount;
        commodityCount++;

        commodities[commodityId] = Commodity({
            commodityType: commodityType,
            producer: msg.sender,
            quantity: quantity,
            price: price,
            deliveryWindow: deliveryWindow,
            isActive: true
        });

        emit CommodityListed(commodityId, commodityType, msg.sender, quantity, price, deliveryWindow);
    }

    function getCommodity(uint256 commodityId) public view returns (Commodity memory) {
        require(commodityId < commodityCount, "Commodity does not exist");
        return commodities[commodityId];
    }

    function getListedCommodities() public view returns (Commodity[] memory) {
        Commodity[] memory result = new Commodity[](commodityCount);
        for (uint256 i = 0; i < commodityCount; i++) {
            result[i] = commodities[i];
        }
        return result;
    }

}

contracts/IHederaTokenService.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.26;
pragma experimental ABIEncoderV2;

interface IHederaTokenService {
    struct Expiry {
        uint32 second;
        uint32 autoRenewPeriod;
    }

    struct HederaToken {
        string name;
        string symbol;
        address treasury;
        string memo;
        bool supplyType;
        uint32 maxSupply;
        bool freezeDefault;
        Expiry expiry;
    }

    struct TokenKey {
        uint256 keyType;
        bytes key;
    }

    function createFungibleToken(
        HederaToken memory token,
        uint64 initialTotalSupply,
        uint32 decimals,
        TokenKey[] memory keys
    ) external payable returns (int64 responseCode, address tokenAddress);

    function mintToken(
        address token,
        int64 amount,
        bytes[] memory metadata
    ) external returns (int64 responseCode, uint64 newTotalSupply, int64[] memory serialNumbers);

    function transferToken(
        address token,
        address sender,
        address recipient,
        int64 amount
    ) external returns (int64 responseCode);

    function transferNFT(
        address token,
        address sender,
        address recipient,
        int64 serialNumber
    ) external returns (int64 responseCode);

    function associateToken(
        address account,
        address token
    ) external returns (int64 responseCode);
}

contracts/TokenAuthority.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.26;

import "./IHederaTokenService.sol";

contract TokenAuthority {
    address public commodityExchange;
    IHederaTokenService public tokenService;
    address public admin;

    mapping(address => bool) public authorizedProducers;
    mapping(string => address) public commodityTokens;
    string[] public commodityTypes;

    event ProducerAuthorized(address indexed producer);
    event ProducerRevoked(address indexed producer);
    event CommodityCreated(string indexed commodityType, address tokenAddress);
    event CommodityMinted(string indexed commodityType, address indexed producer, int64 amount);

    constructor(address _commodityExchange, address _tokenService) {
        commodityExchange = _commodityExchange;
        tokenService = IHederaTokenService(_tokenService);
        admin = msg.sender;
    }

    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this action");
        _;
    }

    modifier onlyCommodityExchange() {
        require(msg.sender == commodityExchange, "Only CommodityExchange can perform this action");
        _;
    }

    function authorizeProducer(address producer) external onlyAdmin {
        authorizedProducers[producer] = true;
        emit ProducerAuthorized(producer);
    }

    function revokeProducer(address producer) external onlyAdmin {
        authorizedProducers[producer] = false;
        emit ProducerRevoked(producer);
    }

    function createCommodity(string memory commodityType, string memory name, string memory symbol) external {
        require(commodityTokens[commodityType] == address(0), "Token for this commodity already exists");

        IHederaTokenService.HederaToken memory token = IHederaTokenService.HederaToken({
            name: name,
            symbol: symbol,
            treasury: address(this),
            memo: string(abi.encodePacked("Commodity Token for ", commodityType)),
            supplyType: true, // Infinite supply
            maxSupply: 0, // No maximum supply
            freezeDefault: false,
            expiry: IHederaTokenService.Expiry({
            second: 0,
            autoRenewPeriod: 0
        })
        });

        (int64 responseCode, address createdToken) = tokenService.createFungibleToken(token, 0, 0, new IHederaTokenService.TokenKey[](0));
        require(responseCode == 0, "Token creation failed");

        commodityTokens[commodityType] = createdToken;
        commodityTypes.push(commodityType);
        emit CommodityCreated(commodityType, createdToken);
    }

    function requestMinting(string memory commodityType, int64 amount, uint256 deliveryWindow, address producer) external onlyCommodityExchange returns (int64 responseCode) {
        require(authorizedProducers[producer], "Producer is not authorized");
        address tokenAddress = commodityTokens[commodityType];
        require(tokenAddress != address(0), "Token for this commodity does not exist");

        // Mint new tokens
        (responseCode,, ) = tokenService.mintToken(tokenAddress, amount, new bytes[](0));
        require(responseCode == 0, "Token minting failed");

        // Transfer the minted tokens to the producer
        (responseCode) = tokenService.transferToken(tokenAddress, address(this), producer, amount);
        require(responseCode == 0, "Token transfer to producer failed");

        emit CommodityMinted(commodityType, producer, amount);

        return responseCode;
    }

    function getCommodityTypes() external view returns (string[] memory) {
        return commodityTypes;
    }

    function getCommodities() external view returns (address[] memory) {
        address[] memory tokens = new address[](commodityTypes.length);
        for (uint256 i = 0; i < commodityTypes.length; i++) {
            tokens[i] = commodityTokens[commodityTypes[i]];
        }
        return tokens;
    }

}

